import React from 'react'

function App () {

  function tick () {
    const date = new Date()
  }
  const element = <h1>Hello World {date.toLocaleTimeString()}</h1>
  setInterval(() => {
    element
  }, 1000)
  return (
    element
  )
}

export default App
